<!doctype html>
<html>
  <head>
    <meta charset="utf-8" />
    <title>Redirectingâ€¦</title>
    <script>
      // Single Page Apps for GitHub Pages
      var l = window.location;
      var repo = "/CoStructure";
      l.replace(
        l.protocol +
          "//" +
          l.host +
          repo +
          "/?p=" +
          encodeURIComponent(l.pathname.replace(repo, "")) +
          "&q=" +
          encodeURIComponent(l.search.slice(1)) +
          "&h=" +
          encodeURIComponent(l.hash.slice(1))
      );
    </script>
  </head>
  <body></body>
</html>
